import React from "react";
import "./styles.scss";
import ContentBlock from "../../components/ContentBlock/ContentBlock";
import Socials from "../../components/Socials/Socials";

import StyledButtonLink from "../StyledButtonLink/StyledButtonLink";

const content = [
  " Want to work together?",
  "Collaborate on a project?",
  "Need help organising an event? ",
  " Want to learn more about internships? Hackathons? ",
];

const ContactSection = () => {
  return (
    <div className="contact">
      <div className="contact-container">
        <h1>Let's Talk.</h1>
        <h3>Want to work together?</h3>
        <h3> Collaborate on a project? </h3>
        <h3> Need help organising an event? </h3>
        <h3>Want to learn more about internships? Hackathons? </h3>
        <StyledButtonLink variant="outlined" size="medium">
          SAY HI
        </StyledButtonLink>
        {/* <Socials /> */}
      </div>
    </div>
  );
};

export default ContactSection;
